				console.log('NA', symbol, index);
			}

			const sleepTime = (index + 1) % 20 === 0 ? 30000 : 0;
			// console.log(sleepTime, index, index % 5, 'sleep set');

			if (sleepTime > 0) console.log('waited', sleepTime, index);
			const u = await sleep(sleepTime);
