		// 		}
		// 		console.log('obj', obj, symbol, index);
		// 	});
		// });
	}

	render() {
		// console.log('props', this.props,this.props.sortConfig,'this.props.sortConfig')
		return (
			<div className=''>
				Unavailable symbols:
				<ul>
					{this.state.unavailableSymbols.map((symbol, index) => (
						<li key={index}>{symbol}</li>
					))}
				</ul>
			</div>
		);
	}
}

export default TestFetch;
